import React from 'react'
import styled from 'styled-components'

const PricesAndServices = () => {
	const services = [
		{
			id: 1,
			title: 'Juste moi',
			description: 'Séance pour une personne, en extérieur ou en studio',
			price: 130,
		},
		{
			id: 2,
			title: 'Pour deux',
			description: 'Pour deux personnes, en extérieur ou en studio',
			price: 195,
		},
		{
			id: 3,
			title: 'Famille',
			description: 'Pour la famille ou les amis jusqu’à 4 personnes, en extérieur ou en studio',
			price: 220,
		},
		{
			id: 4,
			title: 'Il était une fois',
			description: 'Séance pour une personne, en extérieur ou en studio',
			price: 160,
		},
		{
			id: 5,
			title: 'Mon bébé',
			description: 'Séance pour une personne, en extérieur ou en studio',
			price: 100,
		},
		{
			id: 6,
			title: 'J\'immortalise l\'événement',
			description: 'Séance pour une personne, en extérieur ou en studio',
			price: 0,
		},
	]

	return (
		<Main>
			{services.map((service, index) => {
				return (
					<Services key={index}>
						<Title>{service.title}</Title>
						<Description>description={services.description}</Description>
						<Cost>{services.price}</Cost>
					</Services>
				);
			})

			}
		</Main>
	)
}

const Main = styled.div`
	display: flex;
	align-items: center;
	justify-content: center;
	height: calc(100vh - 80px);
`

const Services = styled.div`
	border: 1px solid black;
	width: 15vw;
	height: 10vh;
`

const Title = styled.h2`

`

const Description = styled.p`

`

const Cost = styled.span`

`

export default PricesAndServices
